import { Component } from "react";
import {useState} from 'react';
export default class Artist extends Component{
    constructor(props){
        super(props);
        this.state = {
            isLoaded: false,
            artists: {
                _embedded: {
                    artistList:[]
                },
                _links:{
                    self: {}
                }
            }
        };
    }

    componentDidMount(){
        fetch("/api/songcollection/artists")
        .then(res => res.json())
        .then(
            (result) => {
                this.setState({
                    isLoaded: true,
                    artists: result
                })
            }
        ) 
    }
     handleClick = async () => {
        setIsLoading(true);

        try {
          const response = await fetch('/api/songcollection/artists', {
            method: 'GET',
            headers: {
              Accept: 'application/json',
            },
          });

          if (!response.ok) {
            throw new Error(`Error! status: ${response.status}`);
          }

          const result = await response.json();

          console.log('result is: ', JSON.stringify(result, null, 4));

          setData(result);
        } catch (err) {
          setErr(err.message);
        }
      };

    render(){
        const {isLoaded, artists} = this.state
        if(!isLoaded){
            return <div>Loading...</div>
        }else{
            return (
                <div>

                <button onClick={handleClick}>Fetch data</button>
                {artists._embedded.artistList.map( artist =>{
                    return (
                        <ul>
                            <li key={artist.uuid}>
                {artist.name} {String(artist.active)}
                </li>
                        </ul>
                    )
            })}
            {/* <ul>
            {artists._embedded.artistList.map(artist => (
                <li key={artist.uuid}>
                {artist.name} {String(artist.active)}
                </li>
            ))}
            </ul> */}
            </div>
            )
        }


    }
}
